import React, { Component } from "react";
import Particles from "react-particles-js";

class Header extends Component {
  render() {
    return (
      <div className="header">
        <Particles
          params={{
            particles: {
              line_linked: {
                shadow: {
                  enable: true,
                  color: "#3CA9D1",
                  blur: 5
                }
              }
            }
          }}
        />
      </div>
    );
  }
}

export default Header;
